import React, { useState, useEffect } from 'react';
import {Link} from 'react-router-dom'

function Card() {
    const [recipes, setRecipes] = useState([]);
    useEffect(() => {
        fetch('https://gastronomia-api.herokuapp.com/recipes')
        .then(res => res.json())
        .then(data => {
            console.log(data)
            setRecipes(data)
        })
    }, [])

    return (
        <div>
            <div>{recipes.map(recipe => (
                <Link to='/api'>
            <Recipe 
                title={recipe.title}
                key={recipe.id}
                />
                </Link>
            ))}
            </div>
        </div>
    );
}

export default Card;
